import React from 'react';
import TabItem from './TabItem';

const Tab = () => {

  const menuItems = [
    {name:"Bitcoin"},
    {name:"Etherium"},
    {name:"Cardano"},
   ];

 return (
 <div style={{
   display:"flex",
   justifyContent: "space-evenly",
   width:"100vw",
   height:"70px",
   background:"black",
   position:"absolute",
   bottom:"0",
   color:"red"

 }}
 >
   {menuItems.map((item) => {
     return <TabItem menuItem={item.name}/>
   })}
 </div>  
 );  
};

export default Tab;
